import React from 'react'; 

const Menu = () =>{
    return(
       <li className="f4 mb2 mt2" style={{display:'flex', justifyContent:'space-around'}}>
           <ul className="link pointer blank dim white center">
                <a>Planes</a>
           </ul>
           <ul className="link pointer blank dim white center">
                <a>Nosotros</a>
           </ul>
           <ul className="link pointer blank dim white center">
                <a>Contacto</a>
           </ul>
           <ul className="link pointer blank dim white center">
                <a>Usuarios</a>
           </ul>
       </li>
    )
}

export default Menu;
